import React from 'react';
import images from "./imgs.js";
import Card from "./Card.jsx";
import "./index.css";

function createcard(props)
{
  return(
    <div key={props.id}>
      <Card className="side" val={props.pic} textval={props.text}/>
    </div>
  );
}

function App() {
  return (
    <div >
      <header>
      <img src="images/mainlogo.png" className='mainlogo'  alt="error" />
      </header>
      <div>
      {images.map(createcard)}
      </div>
      <footer className="morefooter">
        <Card  val={"images/Hamburger.png"} textval={"More"}/>
      </footer>
    </div>
  );
}

export default App;
